										if(!temp_variable) {
											console.log(key)
										}
										if(value.signalName=="TT-201储氢装置进气温度" || value.signalName=="1#固态储氢装置平均温度" || value.signalName=="2#固态储氢装置平均温度13" ){
											temp_variable.textContent=parseFloat(value.value).toFixed(2)+"℃";
										} else if(value.signalName=="FT201质量流量计质量流量") {
											temp_variable.textContent=parseFloat(value.value).toFixed(2)+"kg/min";
										} else if(value.signalName=="FT201质量流量计累计量") {
											temp_variable.textContent=parseFloat(value.value).toFixed(2)+"kg";
										} else {
											temp_variable.textContent=parseFloat(value.value).toFixed(2)+"MPa";
										}
										
									}
								}
							};
							for(var i=0,l=plcList2.length;i<l;i++){
							   for(var key in plcList2[i]){
							       if(plcList2[i][key]== value.signalName) {
							       	var temp_red = svg.getElementsByClassName(key+'_red');
							       	var temp_green = svg.getElementsByClassName(key+'_green');
							       	if(value.value=="ON") {
										for(var j=0;j<3;j++){
											temp_red[j].setAttribute('display','none'); 
											temp_green[j].setAttribute('display','block') ;
										}
							       	} else if(value.value=="OFF") {
										for(var k=0;k<3;k++){
											temp_red[k].setAttribute('display','block'); 
											temp_green[k].setAttribute('display','none') ;
										}
							       	}
							       }
							   }
							}
						});
					});
					setTimeout("checkReady()", 10000);
				}
			}
			
		</script>
	</body>
</html>
